Vector layers rendering can be configured with several kinds of symbols according to the geometry type. The symbol selector in QGIS is very dense but for now, only Marker, Line and Fill simple symbols are supported. The /api/symbology endpoint allows to dynamically retrieve the corresponding parameters depending on QGIS Server version. Method URL Description GET /api/symbology/vector/point/single_symbol/marker/properties Marker simple symbol properties GET /api/symbology/vector/line/single_symbol/line/properties Line simple symbol properties GET /api/symbology/vector/polygon/single_symbol/fill/properties Polygon simple symbol properties Examples: $ curl "http://localhost:5000/api/symbology/vector/polygon/single_symbol/fill/properties" | jq
